import React from 'react';
import sdata from './Sdata';
import Cards from './cards'

const favS = prompt("Enter your Fav series");

const myfav = () =>{
if (favS === 'netflix')
{
    return (
        <Cards 
        key={sdata[1].id}
        imgsrc={sdata[1].imgsrc}
        title={sdata[1].title}
        sname={sdata[1].sname}
        links={sdata[1].links}
        />    
      ) 
}
else{
    return (
        <Cards 
        key={sdata[2].id}
        imgsrc={sdata[2].imgsrc}
        title={sdata[2].title}
        sname={sdata[2].sname}
        links={sdata[2].links}
        />    
      )
}
}

const App = () => (
    <>
    <h1 className="heading">List of Best Five Netflix Webseries</h1>
    <myfav />
    </>
);

export default App;
